import PropTypes from "prop-types"
import React from "react";

class App extends React.Component {

  state = {
    count: 0,
  }

  render() {
    return (
      <div>
        <h1>Number: {this.state.count}</h1>
        <button onClick={() => {
          this.state.count += 1
        }}>+</button>
        <button>-</button>
      </div>  
    )
  }
}

export default App;
